import binascii
import os

# Placeholder for the actual hex data
data_hex = ""

# Convert the hex string to bytes
data_bytes = binascii.unhexlify(data_hex)

# Write the bytes to a binary file
with open("output.gz", "wb") as file:
    file.write(data_bytes)

print("File created successfully.")

